import React, { Component } from "react";
import NavBar from "./components/navBar";
//import LoginForm from "./components/loginForm";
//import RegisterForm from "./components/registerForm";
import SideBar from "./components/sideBar";
import Stats from "./components/stats";
import Tab from "./components/tab";
import Chart from "./components/doughnutChart";
import Line from "./components/lineChart";
import Playback from "./components/playback";
import CaptureJob from "./components/captureJobs";

import "./App.css";

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <main className="container">
          <div className="row">
            <div className="col-md-3 bg-light fixed-top">
              <NavBar />
              <SideBar />
              <Chart />
            </div>

            <div className="col-md-9 offset-3">
              <br />
              <br />

              <Stats />
              <br />
              <br />

              <div class="card bg-primary text-white text-center p-3">
                <blockquote class="blockquote mb-0">
                  <Line />
                </blockquote>
              </div>
              <Playback />
              <div class="card bg-success text-white text-center p-3">
                <blockquote class="blockquote mb-0 text-white">
                  <h3 className="text-center text-white">Capture Jobs</h3>
                </blockquote>
              </div>
              <CaptureJob />
            </div>
          </div>
        </main>
      </React.Fragment>
    );
  }
}

export default App;
